import React, { Component } from 'react';
import { Icon } from '@blueprintjs/core';
import '@fortawesome/fontawesome-free/css/all.min.css';
//import '../NavBar/Navbar.css'
import './Sidebar.css';

export default class Sidebar extends Component {
   render() {
      return side_old();
   }
}

const side_old = () => {
   return (
      <div>
         <nav class='main-menu'>
            <ul>
               <li>
                  <Icon icon='home'></Icon>
               </li>
               <li class='has-subnav'>
                  <Icon icon='home'></Icon>
               </li>
               <li class='has-subnav'>
                  <Icon icon='home'></Icon>
               </li>
               <li class='has-subnav'>
                  <Icon icon='home'></Icon>
               </li>
               <li>
                  <Icon icon='home'></Icon>
               </li>
               <li>
                  <Icon icon='home'></Icon>
               </li>
            </ul>
         </nav>
      </div>
   );
};
